import React, {
  useState,
  useEffect
} from "react";
import ReactDOM from "react-dom";
import "./index.css";

function TopAdsData ({ adId }) {
  const [data, setData] = useState(null);
  useEffect(() => {
    // fetch(`https://api.github.com/users/${login}`)
      fetch(`https://api.smartly.io/stats/v2/view/29457?token=04b9d710079c0227dfc0f6924f98c80d&timeframe=last_7_days&timezone=America/Los_Angeles&format=json`)
      .then(res => res.json())
      .then(setData)
      .catch(console.error);
  }, []);

  if (data) {
    return (
      <div>
        <h1>{data.AdId}</h1>
        // <img src={data.avatar_url} width={100} />
      </div>
    );
  }
  return null;
}

function App() {
  // return <GitHub login="moontahoe" />;
  return <TopAdsData/>;
}

ReactDOM.render(
  <App />,
  document.getElementById("root")
);
